
var algoid;var oldtime;var dateaccess;var ipuser;var url=window.location.href;$(document).ready(function(){var b;algoid=parseInt(document.getElementById("algoid").value);oldtime=Date.now();var a=new Date();dateaccess=a.getFullYear()+"/"+(a.getMonth()+1)+"/"+a.getDate()+"  "+a.getHours()+":"+a.getMinutes()+":"+a.getSeconds();$.getJSON("https://api.ipify.org?format=json",function(c){returnip(c.ip)});href=$("#linkfb").attr("data-href");$("#linkfb").attr("data-href",url)});function returnip(a){ipuser=a}function ajaxSendData(c,d,a,b){console.log(d);$.ajax({type:"post",url:"TrackingController",data:{algoid:c,ipuser:d,dateaccess:a,totaltime:b},success:function(e){$("#output").append(e)}})}$(window).on("unload",function(b){var c=Date.now();var a=c-oldtime;window.sessionStorage.setItem("key","algoid");ajaxSendData(algoid,ipuser,dateaccess,a)});